Good things do come in fours when you have the space for 4 carry on luggage in the Gemera. Three in the back and one (laid down) in the front. A compact glass panel in the back rises and is hinged so you can place three cabin bags vertically into a deep luggage compartment.
 
Sure, there are the engine and technical components behind the monocoque, the Tiny Friendly Giant Engine is small by industry standards. This was key when creating the luggage space.
